INSERT INTO `asus-zenbook` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (4, '../img/products/ASUS-ZenBook/Asus ZenBook Pro Duo.webp;', 'Asus ZenBook Pro Duo', 'https://www.amazon.de/ASUS-Zenbook-Notebook-i9-12900H-NVIDIA-RTX-3050Ti/dp/B09QLHDSY7/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2HOB3C625QRV5&keywords=Asus+ZenBook+Pro+Duo&qid=1667509856&qu=eyJxc2MiOiI1LjI0IiwicXNhIjoiNC44OCIsInFzcCI6IjIuMDUifQ%3D%3D&sprefix=%2Caps%2C65&sr=8-2', '2.999,00', 2.6, 3, 0, 'ASUS;1;4;1.75 kg;Ja;SSD;Dediziert;Windows 11 Home;2880 x 1800 pixel;Intel Core i9;2.5 GHz;14.5 Zoll;SSD;2 TB;PCIE x 4;Notebook;L2 cache;2 TB;32 GB;ASUS Computer;PCI Express;-;2880x1800 Pixels;UX8402ZE-M3030W;Kein optisches Laufwerk;2.5 GHz;6;Intel;Intel Core i9;DDR4 SDRAM;Lpddr 5;Mit Intel Core Prozessoren von überall aus wie nie zuvor produzieren, Dinge erschaffen, sich mit anderen verbinden und zusammenarbeiten und die neuesten Games spielen. Sie revolutionieren den Workflow und ermöglichen erstaunliche neue Funktionen mit unglaublicher Leistung.|Die überlegene OLED Display-Technologie mit 400 nits Leuchtkraft, endlich für Notebooks! Perfekter Kontrast, maximale Leuchtkraft und traumhafte Farben. Damit keine Detail verloren geht, weder im Game noch bei der kreativen Arbeit.|Zweites Display immer dabei – in einem Premium-Notebook! Das 15 Zoll große Hauptdisplay wird fast nahtlos mit dem ScreenPad Plus ergänzt für die doppelte Displaypower. Dank der erweiterten Arbeitsfläche lässt sich viel schneller und komfortabler arbeiten.|NVIDIA RTX liefert Raytracing für das Grafik-Nonplusultra und DLSS für die kompromissloseste FPS-Beschleunigung.|Mit dem großen 76Wh-Akku lange aktiv bleiben. Für eine viermal schnellere Datenrate und mehr Stabilität sorgt das moderne WiFi 6. Die innovative RangeBoost-Technologie steigert zusätzlich die Reichweite bis zum Maximum.|System-ram-typ: ddr4_sdram|Welche komponenten sind im lieferumfang des produkts enthaltenen: Netzteil');
